import { Advisors } from '../components/Advisors';
import { Pagination } from '../components/Pagination';

export const SearchResults = ({ loading, searchQuery, currentAdvisors, advisorsArray, currentPage, advisorsPerPage, filteredAdvisors, paginate }) => {


    return (
        <>
            <Advisors
                loading={loading}
                searchQuery={searchQuery}
                //currentAdvisors comes from the pagination
                currentAdvisors={currentAdvisors}
                advisorsArray={advisorsArray}
                currentPage={currentPage}
                advisorsPerPage={advisorsPerPage} />
            <Pagination currentPage={currentPage} advisorsPerPage={advisorsPerPage} totalAdvisors={100} paginate={paginate} />
        </>
    )
}
